import React from "react"; 
import { BrowserRouter as Router, Route, Navigate, Link, Outlet, useParams} from "react-router-dom";

import Home from "./core/Home"; 

const Routes = () => {
    return(
        <Router>
            <Switch>
                <Route path="/" exact element={Home} />
            </Switch>
        </Router>
    );
}


export default Routes;
